public BalanceJob remove(BalanceJob job) {
  BalanceJob inner = findJob(job);
  if (inner == null) {
    return null;
  } else if (job.isJobDone()) {
    synchronized (this) {
      return jobSet.remove(inner);
    }
  }
  return null;
}
